import axios from "axios"
import React from "react"

function Home() {
  const getProducts = async () => {
    try {
      let response = await axios.get("http://localhost:9000/product/products")
      console.log(response.data)
    } catch (error) {}
  }
  return <div>Home</div>
}

export default Home
